import React from "react";
import {
	BrowserRouter as Router,
	Switch,
	Route,
} from "react-router-dom"
import TodoList from "./pages/TodoList"
import Detail from "./pages/Detail";

const App = () => {
	return (
		<Router>
		<Switch>
		  <Route path="/movie/:id">
			<Detail />
		  </Route>
		  <Route path="/">
			<TodoList />
		  </Route>
		</Switch>
	  </Router>
	)
}

export default App;
